import React, { Component } from 'react'
import Layout from '../Components/Layout'

class votingPage extends Component {
    render(){
        return(
            <Layout>
                <Link route ='/'>
                    <a>
                        Home
                    </a>
                </Link>
                <h3>Here the Voting happens</h3>
            </Layout>
        )
    }
}

export default votingPage
